    private final String collectPhotoPath = Config.getInstance().get("collectPhotoPath")+ "/pic/";
    
    @Test
    public void applyCardDirect(){
    	String signPhotoPath = collectPhotoPath + "xxxxx"
				+ ".jpg";
		if (signPhotoPath != null) {
			OutputStream os = null;
			try {
				os = new FileOutputStream(new File(signPhotoPath));
				BASE64Decoder decoder = new BASE64Decoder();
				os.write(decoder.decodeBuffer(""));
			} catch (Exception e) {
				logger.error("电子签名读取错误:",e);
				//return result(message, "电子签名读取错误");
			} finally {
				try {
					if(os!=null)
						os.close();
				} catch (IOException e) {
					logger.error("输出流关闭错误:",e);
				}
			}
		}
    	
    }
    
    
    
    
