    public void callbackPicInfo() {
        String statusCode = Constants.RESULT_MESSAGE_ERROR;
        String message = "照片处理失败";
        JsonObject json = new JsonObject();
        String id = "97";
        json.addProperty("base64String", getImageStr("C:\\Users\\lorn\\Desktop\\bgg.jpg"));
        json.addProperty("busId", id+"");
        json.addProperty("status", "01");
        json.addProperty("message", "chenggong");
        Object jsonData = "";
        try {

            String CARD_CALLBOACKPICINFO="/adapter/cssp/callbackPicInfo";//快速处理照片接口
            jsonData = DictionaryUtil.postClientRequest(json.toString(),URI+CARD_CALLBOACKPICINFO);
            Result data= JsonMapper.buildNormalMapper().fromJson(jsonData.toString(), Result.class);

            logger.info("result:"+JsonHelper.javaBeanToJson(data));

            if(StringUtils.isNotEmpty(String.valueOf(data))) {
                statusCode = data.getStatusCode();
                message = data.getMessage();
                jsonData = data.getData();
            }
        } catch (Exception e) {
            logger.error("照片处理失败:",e);
        }
        assertEquals(message, statusCode, "200");
    }

    public static String getImageStr(String path) {
        String imgFile = path;// 待处理的voice
        InputStream in = null;
        byte[] data = null;
        // 读取照片字节数组
        try {
            in = new FileInputStream(imgFile);
            data = new byte[in.available()];
            in.read(data);
            in.close();
        } catch (IOException e) {
            logger.error("照片处理失败:",e);
        }
        // 对字节数组Base64编码
        BASE64Encoder encoder = new BASE64Encoder();
        return encoder.encode(data);// 返回Base64编码过的字节数组字符串
    }
